function checkForDuplicateGMFunctions()
    local gmFunctions = {}
    for key, value in pairs(GM) do
        if type(value) == "function" then
            if gmFunctions[value] then
                print("Duplicate GM function found: " .. key)
            else
                gmFunctions[value] = key
            end
        end
    end

    print("Duplicate GM function check complete.")
end

checkForDuplicateGMFunctions()